void generateAllHypothesis(set<pair<int, int>>& hypothesis, int numOfPatrons) {
    for (int i = 0; i < numOfPatrons; ++i) {
        for( int j = 0; j < numOfPatrons; ++j) {
            // least all the possible conbination of the indexes of two types of patrons
            if (i != j)
                hypothesis.insert(pair<int,int>(i, j));
        }
    }
    return;

}

int fightOrPeace(pair<int, int> h, vector<int> input_x) {
    //we assume the first element in the pair is position of fighter
    if (input_x[h.first] == 0) {
        return 0;
    }
    if (input_x[h.second] == 0) {
        return 1;
    }

    return 0;
}

set<int> predict(set<pair<int, int>> &hypothesis, vector<int> input_x) {
    set<int> res;
    for (auto h : hypothesis) {
        int temp = fightOrPeace(h, input_x);
        res.insert(temp);
        if (res.size() > 1) {
            return res;
        }
    }
    return res;
}


void updateHypothesis(set<pair<int, int>>&  hypothesis,vector<int> input_x, int fightOccurred) {
    set<pair<int, int>> res;
    for(auto it = hypothesis.begin(); it != hypothesis.end();++it ) {
        int temp = fightOrPeace(*it, input_x);
        if (temp == fightOccurred) {
            res.insert(*it);
        }
    }
    hypothesis.clear();
    for (auto item : res)
        hypothesis.insert(item);
}

